       ('Customer Service Representative',
        'Provides assistance to customers regarding their electricity service, billing inquiries, and complaints.'),
       ('Distribution Supervisor',
        'Oversees the distribution network, ensuring efficient and safe delivery of electricity to consumers.'),
       ('Electrical Engineer',
        'Designs, develops, and oversees the electrical systems and equipment used in power generation and distribution.'),
